import React from 'react';
import ReactDOM from 'react-dom';

function Card(props) {
    console.log(props);
    return (
        <>
            <div className="cards">
                <div className="card">
                    <img src="" alt="no card" className="card_img" />
                    <div className="card_info">
                        <span className="card_category"> </span>
                        <h3 className="card_title"> DARK </h3>
                        <a href="" target="_blank">
                            <button>Watch Now</button>
                        </a>
                    </div>
                </div>
            </div>
        </>
    );
}

ReactDOM.render(
    <>
        <Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"
        title="A Netflix Original Series"
        sname='DARK'
        links='https://www.netflix.com/in/title/80990668?source=35' />
        <Card />
        <Card />
    </>
    , document.getElementById("root")
);
